import React from 'react'
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import Bangalore from '../components/Bangalore';
import PropertyRateinBangalore from '../components/PropertyRateinBangalore';

const PriceTrendinBangalore = () => {
  return (
    <>
    <Navbar/>
    <Bangalore/>
    <PropertyRateinBangalore/>
    <Footer/>
    </>
  )
}

export default PriceTrendinBangalore
